const dslichchayReducerInitialState = {};
const dslichchayReducer = (state = dslichchayReducerInitialState, action) => {
  switch (action.type) {
    case "FETCH_DSLICHCHAY":
      state.dslichchayReducer = action.payload;
      return { ...state };
    default:
      return state;
  }
};

export default dslichchayReducer;
